import { styled } from "styled-components";

const ContainerFooter = styled.div`
.Footer { 
  position: fixed; 
  bottom: 0; 
  left: 0; 
  z-index: 10;
  min-width: 200%;
  min-height: 60px;
  background-color: blue;
}
`;

export {ContainerFooter}
